import { createBrowserRoute, RouterProvider} from 'react-router-dom';
import { Panel } from "./Panel";
import { Field } from "./PlayField";
import { Children } from 'react';

const router = createBrowserRoute([
  {
    path: '/',
    element: <Panel/>,
    children: [
      {
        path: '/game_rules',
        element: <Rules/>
      },
      {
        path: '/sign_up',
        element: <SignUp/>
      },
      {
        path: '/sign_in',
        element: <SignIn/>
      },
      {
        path: '/game',
        element: <PlayField/>
      },
      {
        path: '/forum',
        element: <Forum/>
      }
    ]
  }
])


function App() {
  var userLog = false

  if (userLog == false) {
    return (
      <div className="App">
        <Panel />
        <Field />
      </div>
    )
  } else {
    return (
      <div className="App">
        <Panel />
        <Field />
      </div>
    )
  }
}

export default App;
